        "hrzone_intro_understandhr_des": MessageLookupByLibrary.simpleMessage(
            "Cada zona de frecuencia cardíaca influye en tu cuerpo durante el entrenamiento. Centrarse en diferentes zonas te ayuda a construir una rutina equilibrada para la fuerza, resistencia y potencia. Las zonas más bajas son ideales para calentar y recuperarse, mientras que las zonas más altas impulsan el progreso"),
