            MessageLookupByLibrary.simpleMessage("Zona 1 Calentamiento"),
        "hrzone_intro_zone1_des": MessageLookupByLibrary.simpleMessage(
            "El entrenamiento en esta zona mejora la capacidad de tu corazón para bombear sangre y mejora la capacidad de los músculos para utilizar el oxígeno. El cuerpo se vuelve más eficiente en la alimentación de los músculos en funcionamiento y aprende a metabolizar la grasa como fuente de energía."),
