        "hrzone_intro_zone3_des": MessageLookupByLibrary.simpleMessage(
            "Más efectivo para la aptitud cardiovascular general. Aumenta tu capacidad cardiorespiratoria: es decir, tu capacidad para transportar sangre oxigenada a las células musculares y el dióxido de carbono lejos de las células. También es eficaz para aumentar la fuerza muscular general."),
        "hrzone_intro_zone4":
            MessageLookupByLibrary.simpleMessage("Zona 4 Umbral"),
        "hrzone_intro_zone4_des": MessageLookupByLibrary.simpleMessage(
            "El punto en el que el cuerpo no puede eliminar el ácido láctico tan rápido como se produce se llama umbral de lactato o umbral anaeróbico. Generalmente ocurre alrededor del 88% de la Zona de Frecuencia Cardíaca. El entrenamiento en esta zona ayuda a aumentar el umbral de lactato, lo que mejora el rendimiento. El entrenamiento en esta zona es difícil: tus músculos están cansados, tu respiración es pesada."),
