        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "La variabilidad de la frecuencia cardíaca, también conocida como VFC, representa la variación en el tiempo entre cada latido. Entonces, mientras que su frecuencia cardíaca mide cuántas veces late su corazón por minuto, la VFC es la variación en el tiempo entre esos latidos."),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "Su variabilidad de la frecuencia cardíaca es una expresión importante de cuán bien puede hacer frente y recuperarse del estrés, ya sea un factor de estrés físico (como el ejercicio o la enfermedad) o un factor de estrés emocional y mental (como la ansiedad). Aumentar su variabilidad de la frecuencia cardíaca significa dormir mejor, reducir el dolor y mejorar su salud y estado físico en general."),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "Su variabilidad individual de la frecuencia cardíaca está representada por su puntuación de VFC. La VFC se mide típicamente en milisegundos, siendo una puntuación de VFC más alta indicativa de una mejor salud."),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "Para entender por qué un puntaje alto de VFC es un indicador de buena salud, debe saber que la variabilidad de la frecuencia cardíaca está controlada por el sistema nervioso autónomo (o SNA). El sistema nervioso autónomo regula funciones corporales involuntarias (como la digestión, la presión arterial, la respiración y la frecuencia cardíaca) y está compuesto por dos ramas: el sistema nervioso simpático (\"modo de lucha o huida\") y el sistema nervioso parasimpático (\"modo de descanso, digestión y recuperación\")."),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "El sistema nervioso simpático, comúnmente conocido como el modo \"lucha o huida\", se activa involuntariamente cuando su cuerpo percibe una amenaza. Para protegerse, el cuerpo utiliza el sistema nervioso simpático para acelerar la respiración, aumentar la presión arterial y elevar hormonas del estrés como el cortisol, para asegurarse de que tenga toda la energía y recursos necesarios para mantenerse a salvo en una situación peligrosa."),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "El sistema nervioso parasimpático, el modo \"descanso y digestión\", es un estado de relajación. Disminuye la frecuencia cardíaca, ralentiza la respiración y permite que su cuerpo vuelva a la homeostasis (un equilibrio natural). Cuando estás en un estado parasimpático, tu cuerpo se siente seguro al redistribuir el flujo sanguíneo y la energía a funciones restaurativas como el sueño, la digestión y la reproducción."),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "Por lo tanto, una alta variación en el tiempo entre sus latidos, también conocida como una puntuación HRV alta, significa que su sistema nervioso autónomo puede reaccionar eficientemente al activar el sistema nervioso simpático para hacer frente a situaciones estresantes y luego cambiar al estado parassimpático relajado cuando la amenaza ha pasado."),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "Evaluación de la intensidad y la recuperación: Al monitorear la HRV, las personas pueden obtener una comprensión más precisa de sus niveles de fatiga física y estado de recuperación. Una HRV más baja podría indicar sobreentrenamiento o recuperación insuficiente, lo que podría llevar a ajustes en el plan de ejercicios, como aumentar los períodos de descanso o cambiar a ejercicios de baja intensidad para evitar tensiones excesivas."),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "Conexión entre el estrés psicológico y el rendimiento físico: El estrés psicológico prolongado puede llevar a una disminución de la HRV, afectando el rendimiento atlético. Por lo tanto, mantener una buena HRV contribuye a estados psicológicos y fisiológicos óptimos, mejorando así el rendimiento competitivo."),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "En resumen, la variabilidad de la frecuencia cardíaca juega un papel fundamental en la guía de las rutinas de ejercicio individuales, la monitorización del estado de salud general y la predicción del rendimiento atlético. Al seguir y analizar los cambios en la HRV, las personas pueden tomar decisiones informadas y científicas sobre su régimen de acondicionamiento físico."),
        "workouts_detail_info_hrv_content_title1":
